// import DaycareForm from '../components/daycarecomp/DaycareForm';

class DaycareContainer extends Component {
    render() {
        console.log(this.props.sunnyDaycare, "Daycare Container")
        // let daycare = this.props.sunnyDaycares
        return (


            <div>
                <Welcome />
                <Home getDaycare={this.props.sunnyDaycare} />
                <Daycare getDaycare={this.props.sunnyDaycare}/>
                {/* {daycare.map(d => {
                    <DaycareForm daycareId={d.id}/>
                })} */}

            </div>
        )
    }
}

